void putDol(unsigned int x, unsigned int y, unsigned int team, unsigned int animation){
//	GLCD_bitmap_tScale(100,100,16,16,black_dol, 5);
//	GLCD_bitmap_Drawend(100,100,80,80,omok_map,240,240,40,0);

	if(x>14) x= 14;
	if(y>14) y=14;

	if(x>11 || y>11) animation =0;

	if(mapa[y][x] != 0 && mapa[y][x] != team  ) return 0;
	if(mapa[y][x] == team) animation = 0;

	mapa[y][x] = team;

	unsigned int rx = 2;
	unsigned int ry = 2;

	unsigned int srx = 40 + rx + (16*x);
	unsigned int sry = ry + (16*y);

	const unsigned int dol = team == 1 ? black_dol : white_dol;

	if(animation == 1){
	GLCD_bitmap_tScale(srx,sry,16,16,dol, 4);
	GLCD_bitmap_Drawend(srx,sry,64,64,omok_map,240,240,40,0);
	GLCD_bitmap_tScale(srx,sry,16,16,dol, 3);
	GLCD_bitmap_Drawend(srx,sry,48,48,omok_map,240,240,40,0);
	GLCD_bitmap_tScale(srx,sry,16,16,dol, 2);
	GLCD_bitmap_Drawend(srx,sry,32,32,omok_map,240,240,40,0);
	restoreDols(selector_x, selector_y);
	restoreDols(x, y);
	}else{
		GLCD_bitmap_transparent(srx,sry,16,16,dol);
	}




}

