void restoreDols(unsigned int ox, unsigned int oy){

	for(unsigned int y=0; y<4; y++){

		for(unsigned int x=0; x<4; x++){
			unsigned int ry = oy + y;
			unsigned int rx = ox + x;
				if(mapa[ry][rx] != 0){
					putDol(rx, ry, mapa[ry][rx],0);
				}

			}
	}


}


